#!/usr/bin/env python

import numpy as np

def convert_to_x4_q7_weights(weights, shape):
    weights = np.reshape(weights, shape)
    num_of_rows = shape[0]
    num_of_cols = shape[1]
    opt_weights = np.copy(weights)
    opt_weights = np.reshape(opt_weights, shape[0]*shape[1])
    counter = 0
    for i in range(int(num_of_rows)/4):
      # we only need to do the re-ordering for every 4 rows
      row_base = 4*i
      for j in range (int(num_of_cols)/4):
        # for each 4 entries
        column_base = 4*j
        weights[row_base  ][column_base  ] = opt_weights[counter]
        weights[row_base+1][column_base  ] = opt_weights[counter+1]
        weights[row_base  ][column_base+2] = opt_weights[counter+2]
        weights[row_base+1][column_base+2] = opt_weights[counter+3]
        weights[row_base+2][column_base  ] = opt_weights[counter+4]
        weights[row_base+3][column_base  ] = opt_weights[counter+5]
        weights[row_base+2][column_base+2] = opt_weights[counter+6]
        weights[row_base+3][column_base+2] = opt_weights[counter+7]

        weights[row_base  ][column_base+1] = opt_weights[counter+8]
        weights[row_base+1][column_base+1] = opt_weights[counter+9]
        weights[row_base  ][column_base+3] = opt_weights[counter+10]
        weights[row_base+1][column_base+3] = opt_weights[counter+11]
        weights[row_base+2][column_base+1] = opt_weights[counter+12]
        weights[row_base+3][column_base+1] = opt_weights[counter+13]
        weights[row_base+2][column_base+3] = opt_weights[counter+14]
        weights[row_base+3][column_base+3] = opt_weights[counter+15]
        counter = counter + 16
      # the remaining ones are in order
      for j in range((int)(num_of_cols-num_of_cols%4), int(num_of_cols)):
        weights[row_base][j]   = opt_weights[counter]
        weights[row_base+1][j] = opt_weights[counter+1]
        weights[row_base+2][j] = opt_weights[counter+2]
        weights[row_base+3][j] = opt_weights[counter+3]
        counter = counter + 4
    return weights

